/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<${scopeTag("ui5-dialog", tags, suffix)} header-text="${ifDefined(context.moreColorsFeature.colorPaletteDialogTitle)}"><div class="ui5-cp-dialog-content"><${scopeTag("ui5-color-picker", tags, suffix)}></${scopeTag("ui5-color-picker", tags, suffix)}></div><div slot="footer" class="ui5-cp-dialog-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._chooseCustomColor}">${ifDefined(context.moreColorsFeature.colorPaletteDialogOKButton)}</${scopeTag("ui5-button", tags, suffix)}><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._closeDialog}">${ifDefined(context.moreColorsFeature.colorPaletteCancelButton)}</${scopeTag("ui5-button", tags, suffix)}></div></${scopeTag("ui5-dialog", tags, suffix)}>`; };


	return block0(context);
};

export default main;
